import './App.css';
import React from 'react';
import PersistentDrawerLeft from './Components/searchnav/side_navbar';
import SimpleContainer from './Components/inside_Body/Inside_Side_Bar'
import Classprops from './Components/inside_Body/main_body'
function App() {
  return (
    <div className="App1">
      <div className="App2">
        <PersistentDrawerLeft />
      </div>
      <div>
        <SimpleContainer />
      </div>
      <div><Classprops /></div>
    </div>

  );
}

export default App;
